import React from 'react';
import { Container, Grid, Typography, Card, CardMedia, CardContent, CardActions, Button, Box } from '@mui/material';
import floatProduct from '../assets/float-product.jpg';

const Products = () => {
  const products = [
    {
      id: 1,
      name: 'Premium Float',
      description: 'Luxury float with ergonomic design',
      price: '199.99',
      image: floatProduct,
    },
    {
      id: 2,
      name: 'Sport Float',
      description: 'Durable and lightweight',
      price: '149.99',
      image: floatProduct,
    },
    {
      id: 3,
      name: 'Family Float',
      description: 'Perfect for groups',
      price: '249.99',
      image: floatProduct,
    },
  ];

  return (
    <Container maxWidth="lg" sx={{ my: 4 }}>
      <Typography variant="h1" component="h1" align="center" gutterBottom>
        Our Products
      </Typography>
      <Typography variant="h5" align="center" color="textSecondary" paragraph>
        Discover our collection of premium float products
      </Typography>

      <Grid container spacing={4} sx={{ mt: 4 }}>
        {products.map((product) => (
          <Grid item xs={12} sm={6} md={4} key={product.id}>
            <Card>
              <CardMedia
                component="img"
                height="200"
                image={product.image}
                alt={product.name}
              />
              <CardContent>
                <Typography variant="h5" component="h2">
                  {product.name}
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  {product.description}
                </Typography>
              </CardContent>
              <CardActions>
                <Box sx={{ display: 'flex', justifyContent: 'space-between', p: 2 }}>
                  <Typography variant="h6">${product.price}</Typography>
                  <Button variant="contained" color="primary">
                    Add to Cart
                  </Button>
                </Box>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Products;
